ColorChanger.prototype.HIGHLIGHT_COLOR_PERCENT=0.6;ColorChanger.prototype.SHADOW_COLOR_PERCENT=-0.4;ColorChanger.prototype.TIME_UNTIL_HOVER_OVER_COLOR=1;ColorChanger.prototype.TIME_UNTIL_HOVER_OUT_COLOR=3;function ColorChanger(a){this.backgroundColorElement=a;this._onMouseOverHandler=function(){var b=this;var c=this.backgroundColorElement.style;return function(){c.transitionDuration=b.TIME_UNTIL_HOVER_OVER_COLOR+"s";c.backgroundColor=this.shadowHoverColor}};this._onMouseOutHandler=function(){var b=this;var c=this.backgroundColorElement.style;return function(){c.transitionDuration=b.TIME_UNTIL_HOVER_OUT_COLOR+"s";c.backgroundColor=""}};this._processFlexItem=function(c){c.hoverColor=c.getAttribute("data-hovercolor");c.highlightHoverColor=colorLuminance(c.hoverColor,this.HIGHLIGHT_COLOR_PERCENT);c.shadowHoverColor=colorLuminance(c.hoverColor,this.SHADOW_COLOR_PERCENT);c.style.backgroundColor=colorLuminance(c.hoverColor,this.SHADOW_COLOR_PERCENT*2);var b=c.querySelector(".text_bg").style;b.backgroundColor=c.hoverColor;b.borderTopColor=c.highlightHoverColor;b.borderBottomColor=c.shadowHoverColor;c.onmouseover=this._onMouseOverHandler();c.onmouseout=this._onMouseOutHandler()};this.start=function(){var c=document.getElementsByClassName("flex_item");for(var b=0;b<c.length;b++){this._processFlexItem(c[b])}}}function colorLuminance(d,a){d=String(d).replace(/[^0-9a-f]/gi,"");var c="#";var b;for(i=0;i<3;i++){b=parseInt(d.substr(i*2,2),16);b=Math.round(Math.min(Math.max(0,b+(b*a)),255)).toString(16);c+=("00"+b).substr(b.length)}return c}function executeMobileJavascript(){var b=document.getElementsByClassName("flex_item");var c=document.getElementsByClassName("text_link");for(var a=0;a<c.length;a++){c[a].className+=" mobile"}for(var a=0;a<b.length;a++){b[a].querySelector("a").className+=" hover"}}function moreButtonOn(a,b){a.color="black";a.backgroundColor="white";b.display="block"}function moreButtonOff(a,b){a.color="";a.backgroundColor="";b.display="none"}moreMenuOnclickHandler=function(a,b){return function(){if(b.display!=="none"){moreButtonOff(a,b)}else{moreButtonOn(a,b)}}};function setupMoreMenu(){var a=document.getElementById("show_navbar").querySelector("a").style;var b=document.getElementById("navbar_more").style;moreButtonOff(a,b);document.getElementById("show_navbar").onclick=moreMenuOnclickHandler(a,b)}function runJavascript(){if("transitionProperty" in document.body.style){var a=new ColorChanger(document.body);a.start()}if("ontouchstart" in window){executeMobileJavascript()}setupMoreMenu()}runJavascript();